import React from "react";
import "./CardDetails.css";
import { useDispatch, useSelector } from "react-redux";
import { Link } from "react-router-dom";

const CardDetails = ()=>{
    const {product} = useSelector((state) => state.productDetails);
    console.log(product)
    return (
        <div className="cardDetailsContainer">
            <div className="cardDetailsImg">
                <img src={product.img} alt="" />
                <Link to="/" className="icon"><i class="fal fa-arrow-left"></i></Link>
            </div>
            <div className="cardDetailTitleAndReview">
                <h1>{product.title}</h1>
                <div className="review">
                 <i class="fas fa-star"></i> 
                 {product.review}
                </div>
            </div>
            <p className="cardDetailDescription"></p>
            <div className="cardDetailsPriceAndQuantity"></div>
            <div className="cardDetailBtn"></div>
        </div>
    )
}
export default CardDetails;
